import axios from "axios";

// All of your API requests should be in this file

// export const getMovieGenres = async () => {

// };

// export const getMovieMinVote = async () => {

// };

export const getMovieByLanguage = async () => {
    console.log("hit")
  try {
    const response = await axios.get(
      `${process.env.TMDB_PUBLIC_URL}/3/configuration/languages`,
      {
        headers: {
          Authorization: `Bearer ${process.env.TMDB_ACCESS_TOKEN}`,
        },
      }
    );
    console.log("response", response)
  } catch (error) {
    console.log("Error retreiving languages: ", error);
  }
};
